import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';

@Component({
  selector: 'app-ausnahmen',
  templateUrl: './ausnahmen.component.html',
  styleUrls: ['./ausnahmen.component.css']
})
export class AusnahmenComponent {

  data : any[] = [];
  newItem: any;
  addedItem: any;
  filterName: any = "";
  description: any = "";
  blacklist: any = "";
  editedItem: any;


  ngOnInit() {
    let url = 'https://api.sheety.co/99e2152a57a16b325a082194762b640d/filterkriterienAnbotsabgabe/ausnahmen';
    fetch(url)
    .then((response) => response.json())
    .then(json => {
      // Do something with the data
      console.log(json.ausnahmen);
      this.data = json.ausnahmen;
    });
  }

  createItem(item: any) {
    this.addedItem = Object.assign({}, item);
  }


  editItem(item: any) {
    this.editedItem = Object.assign({}, item);
  }

  onSubmitNew(form: NgForm) {
    const data = this.addedItem;
    let url = 'https://api.sheety.co/99e2152a57a16b325a082194762b640d/filterkriterienAnbotsabgabe/ausnahmen';
    let body = {
      ausnahmen: {
        "orgEinheit": this.addedItem.orgEinheit,
        "email": this.addedItem.email,
        "orgEhActive": this.addedItem.orgEhActive,
        "hhBisBeladezeitendePreisabgabge": this.addedItem.hhBisBeladezeitendePreisabgabge,
